import React from 'react';

class Keyboard extends React.Component {
    constructor(props) {
        super(props);    
    }

    render() {
        return(
            <div className="container text-white">
                <div className="row">
                    <div className="col-9 border bg-dark"></div>
                    <button className="btn col-3 border bg-warning">/</button>
                </div>
                <div className="row">
                    <button className="btn col-3 border">7</button>
                    <button className="btn col-3 border">8</button>
                    <button className="btn col-3 border">9</button>
                    <button className="btn col-3 border bg-warning">x</button>
                </div>
                <div className="row">
                    <button className="btn col-3 border">4</button>
                    <button className="btn col-3 border">5</button>
                    <button className="btn col-3 border">6</button>
                    <button className="btn col-3 border bg-warning">-</button>
                </div>
                <div className="row">
                    <button className="btn col-3 border">1</button>
                    <button className="btn col-3 border">2</button>
                    <button className="btn col-3 border">3</button>
                    <button className="btn col-3 border bg-warning">+</button>
                </div>
                <div className="row">
                    <button className="btn col-6 border">0</button>
                    <button className="btn col-3 border">,</button>
                    <button className="btn col-3 border bg-warning">=</button>
                </div>
            </div>
        );
    }
}

export default Keyboard;
